import { Container, Flex, Heading, Icon, IconProps, Stack, Text } from '@chakra-ui/react'
import React, { useEffect } from 'react'
import { useLocation, useNavigate } from 'react-router-dom'

import { useAuthenticationContext } from '@/features/auth'
import { storage } from '@/utils/storage'

export const LandingContent: React.FC = () => {
  const location = useLocation()

  const navigate = useNavigate()
  const incomingPath: string = location.pathname
  const { isAuthenticated } = useAuthenticationContext()

  useEffect(() => {
    if (incomingPath.includes('/challenge/')) {
      const url = `${incomingPath}${location.search}`

      navigate('/auth/login')
      storage.setToken('INCOMING_PATH', url)
    }
  }, [incomingPath, location.search, navigate])

  return (
    <Container maxW="5xl">
      <Stack
        textAlign="center"
        align="center"
        spacing={{ base: 8, md: 10 }}
        py={{ base: 8, md: 10 }}
      >
        <Heading
          fontWeight={600}
          fontSize={{ base: '3xl', sm: '4xl', md: '6xl' }}
          lineHeight="110%"
        >
          Charge up your brain cells with some{', '}
          <Text as="span" color="orange.400">
            Quiz!
          </Text>
        </Heading>
        <Text color="gray.500" maxW="3xl">
          Play a game of quiz with your friends, and test out each other{`'`}s skill
        </Text>
        <Flex w="full">
          <Illustration height={{ sm: '24rem', lg: '28rem' }} mt={{ base: 12, sm: 16 }} />
        </Flex>
      </Stack>
    </Container>
  )
}

